import React, {Component} from 'react';

const data = [
    {img: '/images/perpusci.png', name: 'second'},
    {img: '/images/perpusci.png', name: 'third'},
]

class Portfolio extends Component {
    render() {
        const dataLoop = data.map((value) => {
            return (
                <div className="pb-2">
                    <div className="card mb-3">
                        <img src={value.img} alt={value.name} className="card-img-top "/>
                        <div className="card-body">
                            <h5 className="card-title">Card title</h5>
                            <p className="card-text">This is a wider card with supporting text below as a natural
                                lead-in to additional content. This content is a little bit longer.</p>
                            <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p>
                        </div>
                    </div>
                </div>
            )
        })

        return (
            <section id="portfolio" className="container pb-5">
                <div className="row">
                    <div className="col">
                        <h3 className="h2 pt-4 mb-3 pb-3">Portfolio</h3>
                        {dataLoop}
                    </div>
                </div>
            </section>
        );
    }
}

export default Portfolio;
